INSERT INTO lodging(ldg_name,ldg_country,ldg_city,ldg_main_img,ldg_sub_img,ldg_info,ldg_maxnop,toilet,shower,p_idx) VALUES('런던스테이','영국','런던','ldg_img01.jpg','ldg_img02.jpg,ldg_img03.jpg,ldg_img04.jpg,ldg_img05.jpg','*3박 미만 숙박을 원하시는 경우 사전 문의 부탁드립니다!
*23년 5월 이후 예약은 23년 2월부터 개시할 예정입니다:)

안녕하세요. 쾌적하고 프라이빗한 여행 공간을 지향하는 런던스테이 입니다.
30대 한국인 부부가 직접 운영하는 소규모 숙소로 총 2개의 방(블루룸, 베이지룸)으로 구성되어 있습니다.
안전하고 프라이빗한 여행이 되실 수 있도록 편안하게 모시겠습니다:)

<주요 특징>
- 1존 런던 중심부에 위치한 숙소로 리젠트파크 옆 주거지역에 위치하여 안전하고 조용한 휴식 공간을 제공합니다.

- 평일 아침 한식조식(꼬리곰탕, 육개장, 김치찌개, 소불고기 등)을 무료 제공해드리며, 컵라면(부분유료)이 구비되어 있습니다.

- 특정시간 출입 제한 등의 번거로운 규칙이 없으며 지내시는 동안 개별 키를 드려 24시간 자유로운 왕래가 가능합니다.

- 모든 방에 시스템 이중창이 설치되어 있어 채광, 단열, 소음에 좋습니다.

- 각 침대마다 개인 옷장 및 노트북 스탠드를 제공하여 쾌적한 휴식과 여행준비가 가능합니다.

- 욕실(1)과 화장실(1)가 분리되어 바쁜 아침 시간 유연한 이용이 가능합니다.

- 엘리베이터가 있어 케리어와 함께 편리한 이동이 가능합니다.

- 주인 부부가 함께 거주하여 안전하고 빠른 피드백이 가능합니다. 그 외 런던꿀팁은 덤!',6,1,1,1);

INSERT INTO lodging(ldg_name,ldg_country,ldg_city,ldg_main_img,ldg_sub_img,ldg_info,ldg_maxnop,toilet,shower,p_idx) VALUES('세도나 해피하우스','미국','아리조나','ldg_newroom_img04.png','bestroom_image02.jpg,bestroom_image04.jpg','안녕하세요.
“칵테일 사랑” 을 부른 가수 신윤미 입니다.
세도나 해피하우스를 방문해주셔서 감사드려요.
저희는 2009 년부터 세도나에 살고 있구요.
2014년부터 해피하우스란 이름으로 민박을 운영하고 있습니다.
세도나는 뛰어난 자연경관과 숨이 탁 트이는 맑은 공기, 700 여개의 하이킹트레일과 100여개의 유명 아티스트 갤러리,
그리고 다양한 레저를 즐기실수 있는 곳입니다.

특히 볼텍스 라고 해서 특별한 에너지가 있는 곳으로도 알려져 있는데요.
해피하우스에 오시면 매일매일 손님들의 성향과 컨디션에 맞는 코스를 알려드리고 원하시는 분들께는 맞춤투어가이드 서비스도 해드리고 있습니다.
오셔서 좋은 에너지도 받으시고 아름다운 자연환경과 예술작품을 즐기시며 잊지못할 행복한 여행이 되실수 있도록 최대한 노력하겠습니다.
감사합니다.',12,3,3,1);

INSERT INTO lodging(ldg_name,ldg_country,ldg_city,ldg_main_img,ldg_sub_img,ldg_info,ldg_maxnop,toilet,shower,p_idx) VALUES('하이파리민박','프랑스','파리','ldg_recocity_img03.png','bestroom_image03.jpg,ldg_newroom_img02.png','안녕하세요^_^ 하이파리민박입니다 ! !

하이파리민박은 파리 1존 안전한 주거지역에 위치하여
맛있는밥, 안전한 위치, 관광지 근접 위치, 깨끗한 시설, 이모님의 정을 느끼실 수 있는 파리의 한인민박 !!
최고급 고층아파트로 24시 경비가 상주하고 있어 안전하게 이용하실 수 있습니다.
고층아파트에서 파리시내를 한눈에 내려다볼 수 있으며, 현대식 건물입니다.

★★ 파리 하이파리민박에서 특별할인 + 서비스 제공 ★★
1) 도미토리 가격이 40유로
2) 지하철역에서 숙소까지 오실때 도보 1분!!!!
3) 지하철역! 숙소! 엘레베이터 설치! 편하게 오실 수 있습니다.
4) 24시간 중앙난방으로 창문을 활짝 열어놓고 있어도 덥습니다.

-오페라, 루브르박물관, 교통의 중심지 샤틀레, 몽주 약국, 라파에트 백화점, 프레땅 백화점 모두 한 번에 갈 수 있고, 그 밖의 대부분 관광지 쉽게 가실 수 있습니다.
-주변에 큰 마트, 유럽에서 제일 큰 아시안 마트,빵집, 카페, 식당 등등이 많이 모여있어서 생활하기 편리하고 깨끗한 동네로 치안도 좋습니다. 

[하이파리민박 시설]
- 4인 도미토리
- 2~3인실(도미토리로 이용가능)
- 화장실 2개, 샤워실 1개

[하이파리민박 서비스]
1. 무선인터넷 무료 이용 가능.
2. 헤어드라이기, 손세정제 무료 제공',13,2,1,1);

INSERT INTO lodging(ldg_name,ldg_country,ldg_city,ldg_main_img,ldg_sub_img,ldg_info,ldg_maxnop,toilet,shower,p_idx) VALUES('로마 골뱅이호텔','이탈리아','로마','bestroom_image04.jpg','ldg_newroom_img02.png','Ciao! 로마 골뱅이 호텔입니다

@로마 골뱅이 호텔은
로마정부의 공식 허가 업체로서 최고의 편의시설과 최상의 서비스로 로마를 찾은 모든 분들과 함께 합니다.

6월1일부터 에어컨 사용시 성수기금액 적용합니다.

@로마 골뱅이 호텔은
로마여행 중 현지 호텔의 이용 시 가장 어려워하시는 유럽 식단과 익숙치 않은 외국의 서비스 및 B&B에서 겪을 수 있는 불편함을 빠짐없이 고려 후 한국 여행자들의 눈높이에 맞춘 편안하고 안락한! 가족및 신혼부부를 위한 전문 한인호텔입니다.

@로마 골뱅이 호텔은
산타마리아 마조레성당의 바로 길 건너편에 위치하고 있습니다.
특히 각종 투어를 신청하신 분들은 미팅 장소까지 편히 찾아가실수 있습니다.
그 외에도 로마 맘마미아 투어 여행사 바티칸 투어. 시내투어. 무료 야경투어 만나시는 장소이기도 합니다.

@로마 골뱅이 호텔은
-4성급 호텔로서 회사직원.부부 커풀 가족단위로만 운영하구요.
호텔에서 카드로 숙박비결제 가능합니다.
1인1박 도시세 3.5유로 추가됩니다.
각방에 화장실 샤워실, 에어컨, tv, 인터넷, 미니냉장고 드라이기 등의 시설과
-매일 개인 당 한 장씩 수건 제공 및 정갈하고 정성이 담긴 (아침,) 한식으로 식사를 제공 해드립니다.

-저희 로마 골뱅이호텔을 찾아주시는 모든 분들이 로마에서의 즐겁고 행복한 추억을 담아가실 수 있도록
-변치않는 고객사랑을 실천하도록 항상 노력하겠습니다.

',24,8,8,1);

INSERT INTO lodging(ldg_name,ldg_country,ldg_city,ldg_main_img,ldg_sub_img,ldg_info,ldg_maxnop,toilet,shower,p_idx) VALUES('앳홈스테이','미국','맨하탄','bestroom_image02.jpg','ldg_img03.jpg,ldg_img05.jpg,ldg_newroom_img02.png,ldg_newroom_img03.png','- 앳홈스테이는 뉴욕 최대 자유여행사 앳홈트립이 운영하는 숙소로 여행에 최적화된 편안한 숙소입니다.
주인과 함께 사는 불편한 민박이 아니라 주인 없이 자율적으로 계시는 퍼니시드 렌탈 아파트먼트의 개념입니다.

★퍼니시드 렌탈 아파트먼트란??★
> 부엌, 화장실, 방 등 모든 가구가 완비된 아파트먼트를 장/단기 임대하는 방식
> 앳홈스테이의 퍼니시드 렌탈 아파트먼트는 뉴욕 자유여행사 앳홈트립이 전문적으로 관리하는 숙소로
호텔과 같은 깔끔한 시설, 개인공간을 합리적으로 이용할 수 있습니다.


- 주 3회 공동구역 청소, 입실/퇴실 시 객실청소를 전문 인력에게 클리닝 서비스를 맡기고 있어
3단계 점검을 통한 철저한 청결관리와 방역으로 더욱 쾌적하게 모십니다.
고객님의 안전을 위해 CCTV 설치, 외부인 출입 통제를 시행하고 있습니다.
- 숙소 예약 손님은 앳홈트립에서 운영하는 타임스퀘어 라운지를 무료로 이용할 수 있고,
여행 전문직원의 일정상담과 입장지, 뮤지컬, 택시예약 등 편리한 여행을 제공합니다.
- 숙소 입실 시 1인 1캐리어 반입 가능(백팩 or 핸드백 1개씩 추가 가능),
2 개 이상일 경우 숙소 체크인시 미리 분류해 오면 보관서비스 가능 (하루 개당 $10, 담당자 사전예약 필수)
입실, 퇴실 당일 앳홈트립 타임스퀘어 라운지에서 캐리어 당일 보관 무료 (오피스 운영시간 월-금, 9:30-18:00)

기다림 끝에 만난 뉴욕, 앳홈스테이와 함께하세요!
다년간 숙소 운영으로 쌓은 노하우로 최고의 여행이 되실 수 있도록,
떠나는 그 순간까지 특별하고 행복한 경험을 누리세요.',32,1,1,1);

